import React from 'react';
import bar from '../styles/MessageBar.module.css';

const MessageBar = () => {
  return (
    <form className={bar.main}>
      <input type="text" placeholder="Your message" />
      <button type="submit">Send</button>
    </form>
  )
}

export default MessageBar;
